import { Typography } from "@material-ui/core";
import React from "react";
import slider1 from "../assests/slider1.jpg";

function SectionA(props) {
  return (
    <div
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        marginTop: 50,
      }}
    >
      <div style={{ width: "50%" }}>
        <div
          style={{
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
          }}
        >
          <div style={{ width: 100 }}>
            <hr />
          </div>
          <div>
            <Typography>CAREER COUNSELLING </Typography>
          </div>
        </div>
        <div style={{ width: 400 }}>
          <Typography style={{ color: " #B3864D", fontSize: "46px" }}>
            LET'S CHANGE HOW AND WHY YOU WORK
          </Typography>
        </div>
      </div>
      <div style={{ width: "50%" }}>
        <img src={slider1} height="400px" width="500px" alt="" />
      </div>
    </div>
  );
}

export default SectionA;
